  render() {
    return (
      <div className="bg">
        <Container>
          <Row>
            <Col>
              <h1 className="text-white bold">
                Make them<br></br> feel your love.
              </h1>
              <p className="text-white">
                Share the gift of healthy eating with your loved ones.
              </p>
              <Button variant="light" href="order">
                Order now
              </Button>{" "}
            </Col>
          </Row>
        </Container>
      </div>
    );
  }
}

export default Banner;
